body:
**Alterações realizadas nessa branch:**

- Alterei os códigos sh para excluir automaticamente pastas e arquivos desnecessários, como os PDFs que não servem para mais nada após as conversões;
- Alterei o local das pastas de conversão e de arquivos renomeados para a pasta .gitignore, pois dessa forma os arquivos TXT não vêm para o GitHub, deixando o repositório mais leve;
- Removi a pasta de arquivos renomeados, que continham os arquivos TXT, pois a pasta agora ficará em outro local e para deixar o repositório sem arquivos desnecessários.

FIX #75

